import React from 'react';

function Header () { 
    return(
        <code>
            <div class="container pb-2 ">
                <h1 class="text-dark">Selamat datang</h1>
                <h4 class="text-dark">di website kami</h4>
                <h5 class="text-primary pt-3"><b>Kenyamanan anda adalah prioritas kami</b></h5>
            </div>
        </code>
    )
}
export default Header;
